{'publishedAt': '2023-04-27T21:17:44Z', 'channelId': 'UCVLMRyUik9KrSdFdfRUiFgg', 'title': 'TAPA CULTURAL #152 - Lula, o desastre internacional', 'description': 'ACESSE O BSM: https://brasilsemmedo.com/

As abobrinhas, asneiras e gafes de Lula já se tornaram internacionais, e o presidente petista agora é páreo duro para o americano Joe Biden.

Hoje, além de comentarmos sobre os problemas diplomáticos que Lula vem causando, vamos fazer um "fact check" nas groselhas proferidas mundo a fora pelo antigo hóspede da carceragem da PF em Curitiba.', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/FPeM9R0YHA4/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/FPeM9R0YHA4/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/FPeM9R0YHA4/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/FPeM9R0YHA4/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/FPeM9R0YHA4/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Bernardo P Küster', 'playlistId': 'UUVLMRyUik9KrSdFdfRUiFgg', 'position': 15, 'resourceId': {'kind': 'youtube#video', 'videoId': 'FPeM9R0YHA4'}, 'videoOwnerChannelTitle': 'Bernardo P Küster', 'videoOwnerChannelId': 'UCVLMRyUik9KrSdFdfRUiFgg'}

{'publishedAt': '2023-03-30T21:19:29Z', 'channelId': 'UCVLMRyUik9KrSdFdfRUiFgg', 'title': 'TAPA CULTURAL #147 - O fim da criatividade - Participação: Luiz Carreira', 'description': 'Há quem aposte que inteligências artificiais, como Chat GPT e Mid jourey, irão substituir escritores e artistas gráficos em um futuro breve. 

É fato que as artes não estão em seu "melhor momento", mas será que estamos diante do fim da criatividade?

O escritor e professor Luiz Carreira, autor do aclamado "A coisa fora do texto", e que acabou de lançar "O mínimo sobre criatividade", pela coleção O Mínimo, é nosso convidado hoje para falar sobre esse tema, que segundo o autor, não é o senso comum sobre "ser espontâneo, extrovertido, desinibido, diferenciado... ter um Dom", é, na verdade, "a nossa capacidade de operar possibilidades e compor"', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/wU8JfuVtuCE/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/wU8JfuVtuCE/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/wU8JfuVtuCE/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/wU8JfuVtuCE/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/wU8JfuVtuCE/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Bernardo P Küster', 'playlistId': 'UUVLMRyUik9KrSdFdfRUiFgg', 'position': 26, 'resourceId': {'kind': 'youtube#video', 'videoId': 'wU8JfuVtuCE'}, 'videoOwnerChannelTitle': 'Bernardo P Küster', 'videoOwnerChannelId': 'UCVLMRyUik9KrSdFdfRUiFgg'}

